import React,{useState,useEffect} from 'react'
import { useSelector,useDispatch } from 'react-redux'
import { Flex,Image, Stack,Button,Text } from '@chakra-ui/react'
import { IoChatbubbleEllipsesOutline,IoChatboxEllipsesOutline } from "react-icons/io5";

const QuestionOne = () => {
    const dispatch = useDispatch()
    const dataQuestionOne = useSelector(state => state.data)
    const customStyles = {
        header: {
          style: {
            minHeight: 30,
          },
        },
          headRow: {
            style: {
              border: 'none',
            },
          },
          headCells: {
            style: {
              color: '#202124',
              fontSize: '14px',
            },
          },
          rows: {
            highlightOnHoverStyle: {
              backgroundColor: 'rgb(230, 244, 244)',
              borderBottomColor: '#FFFFFF',
              borderRadius: '25px',
              outline: '1px solid #FFFFFF',
              fontSize: '16px',
            },
            style:{
              fontSize: '15px',
            }
          },
          pagination: {
            style: {
              border: 'none',
            },
          },
    };
    useEffect(()=>{
        dispatch({type:'data/GET_DATA_QUESTION_ONE'})
    },[])

    useEffect(() => {
        console.log(dataQuestionOne)
    }, [dataQuestionOne])

    return (
        <Flex direction='row' width='100%' height='100vh' bg='#f4f4fc'>
            <Flex flex='3' p='5'>
                <Flex width='100%' height='100%' bg='#fff' direction='column' alignItems='center' rounded={30}>
                    <Image
                        // borderRadius="full"
                        mt='50'
                        width='50%'
                        src={require('./../../assets/img/Logo_beta_11.png')}
                        alt="logo"
                    />
                    <Stack width='100%' mt={20} spacing={0}>
                        <Button _focus={{boxShadow: "none"}} width='100%' height={59} colorScheme="cyan" variant="ghost">
                            <IoChatbubbleEllipsesOutline size={25} />
                            <Text ml={3} >
                                Question One
                            </Text>
                            <Flex width='2' position='absolute' right='0' height='100%' bg='indigo'/>
                        </Button>
                        <Button _focus={{boxShadow: "none"}} width='100%' height={59} colorScheme="cyan" variant="ghost">
                            <IoChatboxEllipsesOutline size={25} />
                            <Text ml={3} >
                                Question Two
                            </Text>
                        </Button>
                    </Stack>
                </Flex>
            </Flex>
            <Flex flex='11' p={5}>
                <Flex width='100%' height='100%' bg='#fff' direction='column' alignItems='center' rounded={30}>
                </Flex>
            </Flex>
        </Flex>
    )
}

export default QuestionOne
